import React from "react";
import "./App.css";
import WarmingUpPage from "./pages/game/WarmingUpPage";
import MainPage from "./pages/main/MainPage";

function App() {
  return (
    <div className="App">
      {/* 루트가 /면? mainpage띄우기 .if 삼항연산자사용하면됨 */}
      <MainPage />
      <WarmingUpPage />
    </div>
  );
}

export default App;
